import React from "react";
import "./App.css";
import WeightDisplay from "./features/user/WeightDisplay";
import { Container } from "semantic-ui-react";
import {Route, Switch} from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Switch>

        <Route exact path="" render={() => <WeightDisplay />}/>
      </Switch>
    </div>
  );
}

export default App;
